description:
LIVE FROM NEW YORK - its the TryPod!! The guys are in New York this week for the Youtube Creators Summit. They party, they rollerblade, and Eugene becomes the party shepherd for the youtube community. Also, they read some of those salacious secrets people left in their review comments. 
New Episodes of the TryPod come out every Thursday. Rate, subscribe, and tell us a secret in the comments so we can read them on the podcast!
